import React from 'react'
import { useState, useEffect } from 'react'
import { BrowserRouter as Router, Switch, Route, Redirect,} from "react-router-dom";
import ReactDOM from 'react-dom'
//import Summary from "./components/Summary"

function App() {
  // user's response
  const [name, setName] = useState("");

  // backend data 
  const [qn, setQn] = useState({});
  const list = []
  const curr = 0

  // fetch list of questions 
  const getQuestion = fetch("http://localhost:3500/questions/1")
    .then(res => res.json())
    .then(res => setQn(res))

  const printQn = async () => {
    const theQn = await getQuestion
    console.log(theQn)
  }

  const handleSubmit = (e) => {
    e.preventDefault();
    // qns.data.forEach(console.log)
    //alert(`Response submitted! Have a good day!`)
  }

  return (
    <div>
      {}
      <form onSubmit={handleSubmit}>
        <label>
          <p> Name? </p>
          <input 
            type="text"
            value={name}
            onChange={(e) => setName(e.target.value)}
          />
        </label>
        <input type="submit" />
      </form>
    </div>
  )
}

